const Footer = () => {
    return (

        <footer className="footer mt-auto py-3 bg-dark">
            <div className="container">
                <p className="text-light">App desenvolvido por <a href="https://github.com/vitorcarvalho2/ccp.git" target="_blank" rel="noreferrer">Jose Humberto</a></p>
                <p className="text-light"><small><strong>Desenvolvimento de Aplicações WEB - BCC - UFJ</strong><br />
                    Disciplina de Desenvolvimento de Aplicações WEB: <a href="https://github.com/marcoswagner-commits/gestao_obras_aula_daw" target="_blank" rel="noreferrer">DAW</a></small></p>
            </div>
        </footer>
    );
}

export default Footer;
